import { useState } from "react";
import "./register.css";

export default function Register() {

    const [username, setUsername] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");

    const handleSubmit = e => {
        e.preventDefault();
    }

    return (
        <div className="login">
            <spam className="loginTitle">
                Register
            </spam>
            <form className="loginForm" autoCcomplete="off" onSubmit={handleSubmit}>
                <label>Email</label>
                <input className="loginInput" type="email" placeholder="Enter your email.." onChange={e => setUsername(e.target.value)}/>
                <label>Username</label>
                <input className="loginInput" type="text" placeholder="Enter your username.." onChange={e => setEmail(e.target.value)} />
                <label>Password</label>
                <input className="loginInput" type="password" placeholder="Enter your password.." autocomplete="new-password" onChange={e => setPassword(e.target.value)} />
                <button type="submit" className="loginButton">Register</button>
            </form>
            <button className="registerButton">
                <Link className="link" to="/login">Login</Link>
            </button>
        </div>
    )
}
